import { Carousel } from "antd";
import "./WhichWaterDoYouDrink.css";

const list = [];
for (let i = 0; i < 12; i++) list.push({'name': String()})

function WhichWaterDoYouDrink() {
  const onChange = (list) => {
    console.log(...list);
  };

  return (
    <Carousel afterChange={onChange}>
        {}
      <div>
        <h3 className="Carousel">1</h3>
      </div>
      <div>
        <h3 className="Carousel">2</h3>
      </div>
      <div>
        <h3 className="Carousel">3</h3>
      </div>
      <div>
        <h3 className="Carousel">4</h3>
      </div>
    </Carousel>
  );
}

export default WhichWaterDoYouDrink;
